import React from 'react'
import styled from 'styled-components'

const Navbar = () => {
  return (
    <Navbar>
        <UlMenu>
            <li>anasayfa</li>
            <li></li>
        </UlMenu>
    </Navbar>
  )
}

const NavbarMenu = styled.nav`
    backgound-color: orange;
    padding: 10px;
`

const UlMenu = styled.ul`
    display: flex;
`

export default Navbar
